import base64toFile from '../index';
const base64String =
  'data:image/png;base64,';

test('Base64 file upload', async () => {
  const result = await base64toFile(base64String, null);
  expect(typeof result).toBe('string');
});
test('Base64 file upload with then', async () => {
  base64toFile(base64String, null).then((result) => {
    expect(typeof result).toBe('string');
  });
});
test('Base64 file upload with filename', async () => {
  const result = await base64toFile(base64String, { fileName: 'hello' });
  expect(result).toBe('hello.png');
});
test('Base64 file upload with filepath', async () => {
  const result = await base64toFile(base64String, { filePath: './uploads/pathtwo' });
  expect(typeof result).toBe('string');
});
test('Base64 file upload with filesize', async () => {
  const result = await base64toFile(base64String, { fileMaxSize: 30000 });
  expect(typeof result).toBe('string');
});
test('Base64 file upload with randomizefilenamelength', async () => {
  const result = await base64toFile(base64String, { randomizeFileNameLength: 14 });
  expect(typeof result).toBe('string');
});
test('Base64 file upload with all options', async () => {
  const result = await base64toFile(base64String, {
    fileName: 'hello',
    filePath: './uploads',
    randomizeFileNameLength: 14,
    types: ['png'],
    fileMaxSize: 30000,
  });

  expect(typeof result).toBe('string');
});
test('Base64 file upload invalid path', async () => {
  await expect(base64toFile(base64String, { filePath: './demo' })).rejects.toThrow('No such file or directory');
});
test('Base64 file upload invalid filetype', () => {
  base64toFile(base64String, { types: ['jpg'] }).then(
    (result) => {},
    (error) => {
      expect(error.message).toBe('Invalid file type!');
    },
  );
});
test('Base64 file upload large file', async () => {
  await expect(base64toFile(base64String, { fileMaxSize: 10000 })).rejects.toThrow('File too large!');
});
test('Base64 file upload invalid base64', async () => {
  await expect(base64toFile('azizalkan', null)).rejects.toThrow('Invalid base64 string!');
});
